    public DenseMatrix getInfinitesimal(SiteModel siteModel) {
        if (infinitesimal == null) {
            this.infinitesimal = new DenseMatrix(BlockwiseSiteModel.getKernel(blockSize, leftNeighbors, rightNeighbors, siteModel));
        }
        return infinitesimal;
    }

    public int[] sample() {
        List<Pair<Integer, Double>> possibleStates = new ArrayList<>();
        for (int i = 0; i < logPmf.length; i++) {
            possibleStates.add(new Pair<>(i, Math.exp(logPmf[i])));
        }
        EnumeratedDistribution<Integer> distribution = new EnumeratedDistribution<>(possibleStates);
        return decode(distribution.sample());
    }

    public double evaluateLogLikelihood(int[] states) {
        return logPmf[BlockwiseSiteModel.encode(states)] - Utils.logSum(logPmf);
    }

    public double evaluateLeftLogLikelihood(int[] states) {
        double ll = 0.0;
        double[][] pmfs = getIndividualPmfs();
        for (int i = 0; i < states.length; i++) {
            ll += Math.log(pmfs[i][states[i]] / Arrays.stream(pmfs[i]).sum());
        }
        return ll;
    }

    public double evaluateRightLogLikelihood(int[] states) {
        double ll = 0.0;
        double[][] pmfs = getIndividualPmfs();
        for (int i = blockSize - states.length; i < blockSize; i++) {
            ll += Math.log(pmfs[i][states[i + states.length - blockSize]] / Arrays.stream(pmfs[i]).sum());
        }
        return ll;
    }

    public int getBlockSize() {
        return blockSize;
    }

    public int getContextLength() {
        return contextLength;
    }

    public int[] getLeftNeighbors() {
        return leftNeighbors;
    }

    public int[] getRightNeighbors() {
        return rightNeighbors;
    }

    public int getLeftNeighbor(int site) {
        return leftNeighbors[site];
    }

    public int getRightNeighbor(int site) {
        return rightNeighbors[site];
    }

    public double[] getLogPmf() {
        return logPmf;
    }

    public void fillLogPmf(double[] logPmf) {
        this.logPmf = logPmf;
    }

    public double getLogPmfValue(int index) {
        return logPmf[index];
    }
